import React, { useState, useEffect } from 'react';
import axios from 'axios';
import MockAdapter from 'axios-mock-adapter';
import TableContainer from '@mui/material/TableContainer';
import Table from '@mui/material/Table';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import TableCell from '@mui/material/TableCell';
import TableBody from '@mui/material/TableBody';
import Paper from '@mui/material/Paper';

function CheckAllStatus() {

  const initialData = [
    { id: 1, name: 'ตรวจสอบคุณสมบัติการยื่นสอบโครงงานพิเศษ 1', status: 'ผ่าน', remark: '-' },
    { id: 2, name: 'คำร้องขอเป็นคู่โครงงาน', status: 'ผ่าน', remark: '-' },
    { id: 3, name: 'คำร้องขอเป็นอาจารย์ที่ปรึกษาโครงงาน', status: 'รอดำเนินการ', remark: '-' }, // Initially pending
    { id: 4, name: 'การสอบหัวข้อ', status: 'ผ่าน', remark: 'แก้ไข ER' },
    { id: 5, name: 'การสอบก้าวหน้า', status: 'กำลังดำเนินการ', remark: '' },
    { id: 6, name: 'ตรวจสอบคุณสมบัติการยื่นสอบโครงงานพิเศษ 2', status: 'ยังไม่มีการทำรายการ', remark: '' },
    { id: 7, name: 'การสอบป้องกัน', status: 'ยังไม่มีการทำรายการ', remark: '' },
  ];

  const [checkAllStatus, setCheckAllStatus] = useState(initialData);

  useEffect(() => {
    const mock = new MockAdapter(axios);

    // Mocking the Project API response
    mock.onGet('http://localhost:9999/Project').reply(200, [
      { name: 'คำร้องขอเป็นอาจารย์ที่ปรึกษาโครงงาน', P_status: 'กำลังดำเนินการ' },
      // Add more mock project data as needed
    ]);

    const fetchData = async () => {
      try {
        const response = await axios.get('http://localhost:9999/Project');

        // Check if the `P_status` is 'กำลังดำเนินการ' and update the status accordingly
        const updatedData = checkAllStatus.map((item) => {
          if (item.name === 'คำร้องขอเป็นอาจารย์ที่ปรึกษาโครงงาน') {
            const project = response.data.find(proj => proj.name === item.name);
            if (project && project.P_status === 'กำลังดำเนินการ') {
              return { ...item, status: 'ผ่าน' };
            }
          }
          return item;
        });

        setCheckAllStatus(updatedData);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      <h1>ตรวจสอบสถานะต่างๆ</h1>
      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>ลำดับที่</TableCell>
              <TableCell>รายการ</TableCell>
              <TableCell>สถานะ</TableCell>
              <TableCell>หมายเหตุ</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {checkAllStatus.map((item) => (
              <TableRow key={item.id}>
                <TableCell>{item.id}</TableCell>
                <TableCell>{item.name}</TableCell>
                <TableCell>{item.status}</TableCell>
                <TableCell>{item.remark}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
}

export default CheckAllStatus;
